Мы быстро найдём свободную машину рядом с вами.

Наблюдайте за приближением авто на экране вашего телефона в режиме реального времени! Пока авто едет к вам, вы будете видеть время прибытия, a также фото и персональный рейтинг водителя.

Заказ в аэропорт / трансфер в аэропорт:
“Taxi Hyzmaty” - это прекрасная возможность сделать заказ и с комфортом добраться до аэропорта.


Основные возможности приложения:

- Заказ авто без звонка диспетчеру. Отметьте точку на карте, не нужно писать длинный адрес вручную;

- Предварительный расчёт стоимости поездки;

- Поиск машины с учетом тарифа и ваших пожеланий (детское кресло, выдача квитанции и т.д.);

- Приложение показывает подробную информацию о водителе и его автомобиле;

- Движение водителя видно на карте;

- После поездки оставьте отзыв о качестве обслуживания;

- Сохраните популярные адреса и быстро выбирайте их;

- Звуковой сигнал проинформирует вас о прибытии авто;

- История заказов. Повтор заказа. Обратная поездка.


Понравилось приложение? Расскажите друзьям.
